import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { StoreProvider } from "./EccomerceShop/context/Store";
import { CartStoreProvider } from "./EccomerceShop/context/CartStore";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <StoreProvider>
      <CartStoreProvider>
        <App />
      </CartStoreProvider>
    </StoreProvider>
  </React.StrictMode>
);
